import s from "./Post.module.css";

const Post = () => {
  return (
    <div className={s.content}>
      
      <div className={s.item}>
        <img src="https://i.pinimg.com/originals/f9/82/7a/f9827a43b8c9a91461d059ac092b4ab9.jpg" alt=""/>        
        post 1</div>
        <div className={s.item}>
        <img src="https://i.pinimg.com/originals/f9/82/7a/f9827a43b8c9a91461d059ac092b4ab9.jpg" alt=""/>        
        post 2</div>
        <div className={s.item}>
        <img src="https://i.pinimg.com/originals/f9/82/7a/f9827a43b8c9a91461d059ac092b4ab9.jpg" alt=""/>        
        post 3</div>
      <div>post 4</div>
      <div>post 5</div>
      <div>post 6</div>
    </div>
  );
};

export default Post;
